import {
    UilChartPieAlt,
    UilShoppingCart,
    UilPricetagAlt,
    UilUsersAlt,
    UilMoneyWithdrawal,
    UilUsdSquare,
    UilClipboardAlt
} from "@iconscout/react-unicons"

// Sidebar Data
export const SidebarData = [
    {
      icon: UilChartPieAlt
    },
    {
      icon: UilShoppingCart
    },
    {
      icon: UilPricetagAlt
    },
    {
      icon: UilUsersAlt
    }
];

export const cardsData = [
  {
    title: "Revenue",
    color: {
      backGround: "rgb(31, 29, 43)",
      // boxShadow: "0px 10px 20px 0px #e0c6f5",
    },
    barValue: 70,
    value: "25,970",
    png: UilUsdSquare,
    series: [
      {
        name: "Sales",
        data: [31, 40, 28, 51, 42, 109, 100],
      },
    ],
  },
  {
    title: "Customer",
    color: {
      backGround: "linear-gradient(180deg, #FF919D 0%, #FC929D 100%)"
    },
    barValue: 80,
    value: "14,270",
    png: UilMoneyWithdrawal,
    series: [
      {
        name: "Customer",
        data: [10, 100, 50, 70, 80, 30, 40],
      },
    ],
  },
  {
    title: "Rating",
    color: {
      backGround:
        "linear-gradient(rgb(248, 212, 154) -146.42%, rgb(255 202 113) -46.42%)"
    },
    barValue: 60,
    value: "4,270",
    png: UilClipboardAlt,
    series: [
      {
        name: "Expenses",
        data: [10, 25, 15, 30, 12, 15, 20],
      },
    ],
  },
];
